import React from 'react';
import { Menu, Row, Col } from 'antd';
//import { AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
import "./Header.scss";
const handleClick = (e) => {
    console.log(e.target);
}
const Header = () => {
    return (
        <>
            <Row>
                <Col span={24} >
                    <Menu onClick={handleClick} selectedKeys={"hehe"} mode="horizontal">
                        <Menu.Item className="logo-item" key="mail">
                            <img width="40px" src="../images/logo.png" ></img>
                        </Menu.Item>
                        <Menu.Item key="app">
                            Gây quỹ
                        </Menu.Item>
                        <Menu.Item key="about">
                            Về chúng thôi
                        </Menu.Item>
                        <Menu.Item key="contact">
                            Liên hệ
                        </Menu.Item>
                        <Menu.Item className="right-lg ant-btn ant-btn-primary" key="login"  >
                            Đăng nhập
                        </Menu.Item>
                        <Menu.Item className="right \" key="sign-up" >
                            Đăng kí
                        </Menu.Item>
                    </Menu>
                </Col>
            </Row>


        </>
    );
}

export default Header;
